import Modal from "../Modal/Modal";
import Title from "../Title/Title";
import Button from "../Button";
import InputText from "../InputText/InputText";
import InputRadio from "../InputRadio/InputRadio";
import style from "./AddCategoryModal.module.css";
import {
  BsFillHeartFill,
  BsExclamationOctagonFill,
  BsTrophy,
  BsFillAwardFill,
  BsFillBriefcaseFill,
  BsFillEnvelopeOpenFill,
} from "react-icons/bs";

import { FaAlipay, FaCcAmazonPay, FaCcApplePay } from "react-icons/fa";

function AddCategoryModal(props) {
  return (
    <Modal className={style.modal}>
      <Title>add {props.title} category</Title>
      <hr className={style.line} />
      <form className={style.form}>
        <InputText
          id="name"
          type="text"
          label="name"
          classLabel={style.label}
          classInput={style.input}
          classInputContainer={style["input__container"]}
        />
        <div>
          <p>icon</p>
          <div className={style["icon__container"]}>
            <InputRadio name="icon" label="aa" />
